import { useNavigate } from "react-router-dom";
import "../styles/main.css";
import weddingImage from "../styles/images/wedding.jpeg"; // Menggunakan nama variabel yang sesuai untuk gambar

const Invitationn = () => {
  const navigate = useNavigate();

  return (
    <div>
      <div className="center" id="contentB">
        <div>
          <div className="image-container">
            <img src={weddingImage} alt="" />{" "}
            {/* Menggunakan variabel gambar yang benar */}
            <button onClick={() => navigate("/content")}>
              Open Invitation
            </button>
            <p>
              Lorem, ipsum dolor sit amet consectetur adipisicing elit. Natus
              magnam, temporibus modi placeat mollitia error inventore quis
              quas, reiciendis aperiam, officia recusandae quasi! Ut nobis iure
              esse reiciendis delectus neque! Ipsa eum nulla itaque aspernatur
              ipsam inventore harum alias deleniti, dolores voluptate nihil quos
              rem eligendi autem minus, delectus sunt maxime cumque rerum. At
              molestias, nesciunt facere eum nobis tenetur? Reiciendis
              distinctio corrupti iure velit, alias pariatur dolore ea numquam
              eaque inventore veritatis esse voluptates suscipit harum
              repudiandae consequuntur repellendus fugiat provident dicta
              obcaecati libero eligendi amet laboriosam. Molestiae, temporibus!
            </p>
          </div>

          <br />
          <br />
          <p>Hello World</p>
        </div>
      </div>
    </div>
  );
};

export default Invitationn;
